import Nav from 'react-bootstrap/Nav';

function CommunityTab() {
  return (
    <Nav variant="tabs" >
      <Nav.Item>
        <Nav.Link href="/market">식물마켓</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/talk">소통마당</Nav.Link>
      </Nav.Item>
    </Nav>
  );
}

export default CommunityTab;
